import React, {Component} from 'react'
import { Link } from "react-router-dom";

class Form extends Component {
    render() {
        return (
            <div class="box">
                <div class="form">
                    <div class="title">Carica</div>
                    <div class="contenuto">
                        <form id="myForm">
                            <div class="bottone">
                                <input type="file" accept=".csv" id="csvFile"/>
                            </div>
                            <div class=" elaborazione_form">
                            <Link to="result" className="button">Elabora</Link>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        );
    }
}

export default Form;
